import './App.css';
import Homepage from './pages/homepage/homepage.component';
import {Route, Routes, BrowserRouter} from 'react-router-dom'

function Home(){
  return <h1>Homepage</h1>;
}

function Hat(){
  return <h1>Hat</h1>;
}

function App() {
  return (
    <div>
    //<Homepage />
    <BrowserRouter>
    <Routes>
    <Route path="/" element={<Home/>}/>
    <Route path="/hat" element={<Hat/>}/>
    </Routes>
    </BrowserRouter>
    </div>
  )
}

export default App;
